02-27 13:37:15'),(196,104,51,'2017-02-27','2017-02-27 13:37:15','2017-02-27 13:42:18'),(197,104,52,'1、全身反应：急性炎症患者体温常升高，白细胞计数增多，良性骨肿瘤病人体温正常，血象正常。某些恶性骨肿瘤如未分化网状细胞肉瘤或生长迅速的恶性肿瘤的病人也有体温升高和白细胞计数增多的表现。急、慢性炎症和骨结核病人血沉多增快，良性骨肿瘤血沉多正常，恶性骨肿瘤病人血沉常增快。\n2、发展过程：炎症在发展到一定程度或经过抗炎治疗后多逐渐消退，某些良性骨肿瘤在发展到一定程度后可停止发展，恶性骨肿瘤则继续发展破坏，自行停止或消失者极为罕见。\n3、局部触诊：炎症常产生脓肿，一般质软，波动明显。骨肿瘤一般多较坚硬或硬韧，触之有实体感，边境多清楚，其墓底多与骨粘连而不能移动。但某些血管丰富或有出血的恶性肿瘤也可有波动感。\n4、穿刺：脓肿穿刺多可吸出脓液，脓液培养或涂片染色有时可查出化脓菌。肿瘤穿刺则仅能吸出血液，用粗针头穿刺有时可吸出肿瘤组织碎片。','2017-02-27 13:37:15','2017-02-27 13:43:19'),(198,104,55,'入院第2天。许主治医师巡诊病房，分析如下。    根据病史、体征，结合辅助检查结果，发现该患者有以下特点：①中年妇女；②左乳无痛性肿块进行性增大5月余；③肿块直径5×4×4cm，其表面皮肤可见“桔皮样”改变，质偏硬，不光滑，界限不清，与皮肤有粘连；④左乳头抬高，体积略大于右侧；⑤B超及钼靶片均提示左乳外上象限肿块，恶变可能性大。因此，初步考虑左乳癌的诊断。但须与下列疾病相鉴别。    1.乳房纤维腺瘤常见于青年妇女，很少发生在绝经后。肿块与皮肤和周围组织无粘连，易推动，生长缓慢，可多年无变化。与本患者体征不相符合。   2.乳管内乳头状瘤本病多见于中年妇女，轻压乳房后乳头有血性液体溢出，一般扪不到肿块，有癌变可能。此患者无乳头溢液史，不支持此诊断。3.乳腺囊性增生病 多见于25～40岁经期女性，经期前乳房有胀痛。肿块呈结节状，大小不一，质韧而不硬，与皮肤和深部组织无粘连。该患者情况都不支持。    4.乳房结核比较少见，早期与乳癌不易鉴别。可做穿刺病理学检查来确定。从患者的病史和体检结果来看，诊断该病无依据。    5.外伤性脂肪坏死常发生于肥大的乳房，多于挫伤后数日发生，而外伤史不一定能问出。该患者经反复追问无外伤史，故此诊断不考虑。   综上所述，考虑该患者的左乳肿块以乳癌可能性较大。    刘医师最后指出：乳癌与肉瘤的鉴别也很重要，此患者从年龄、病程短、无痛、单个肿块来看，都和肉瘤相同，但肉瘤肿块界限清楚，活动度不受限，多为血液转移。本病例肿块界限不清，活动度小，有腋部淋巴结转移，故仍诊断为乳癌。有关乳房肿块的辅助检查，除钼靶X线摄影术、硒板静电摄影术、B超、乳管造影、乳头分泌物涂片、肿块穿刺吸引活检外，必要时还可做放射性核素扫描、CT、液晶热图相、红外线热图相和免疫学检查。都有助于术前诊断。 ','2017-02-27 13:52:34','2017-02-27 13:52:34'),(199,104,53,'1、手术切除是治疗的主要手段。截肢、关节离断是最常用的方法。但是，由于化疗方法的进步，近年来一些学者开始作瘤段切除或全股骨切除，用人工假体置换。采取保留肢体的“局部广泛切除加功能重建”辅以化疗等措施，是一种可取的方法。\n2、化学治疗分全身化疗、局部化疗，常用的药物有阿霉素及大剂量氨甲喋呤，但药物的作用选择性不强，肿瘤细胞在分裂周期中不同步，都影响化疗的效果。\n3、局部化疗包括动脉内持续化疗及区域灌注，其中以区域灌注效果较好。\n4、免疫疗法：干扰素其来源有限，还不能广为应用。\n5、放疗方法对骨肿瘤的治疗只能作为一种辅助治疗。','2017-02-27 13:52:35','2017-02-27 13:52:35'),(200,85,41,'','2017-02-27 16:38:10','2017-02-27 16:38:10'),(201,85,42,'','2017-02-27 16:38:10','2017-02-27 16:38:10'),(202,85,43,'','2017-02-27 16:38:10','2017-02-27 16:38:10'),(203,85,44,'','2017-02-27 16:38:10','2017-02-27 16:38:10'),(204,85,45,'','2017-02-27 16:38:10','2017-02-27 16:38:10'),(205,85,46,'','2017-02-27 16:38:10',